<html lang="en"><head>
   <meta charset="utf-8">
   <meta http-equiv="X-UA-Compatible" content="IE=edge">
   <meta name="viewport" content="width=device-width, initial-scale=1">
   <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css">
   <link rel="stylesheet" type="text/css" href="https://cdn.jsdelivr.net/gh/spiermar/d3-flame-graph@2.0.3/dist/d3-flamegraph.css">

<style>
      body {
         background-color: #1B2024;
      }

      .container {
         padding-left: 0px;
         margin-left: 40px;
      }
      .btn {
         border-radius: 10px;
         border: 1px solid #20b6b0;
         background-color: #20b6b0;
         color: #1B2024;
         font-weight: bold;
         font-family: pragmatica, sans-serif;
      }

      .btn:hover {
         background-color: #494949;
         color: #fff;
      }

      .btn:focus {
         border-radius: 10px;
         border: 1px solid #20b6b0;
         background-color: #20b6b0;
         color: #fff;
      }

      .btn:active {
         color: #fff;
         background-color: #494949;
      }

      .header {
         margin-top: 30px;
         padding-right: 40px;
         width: 1840px;
         left: 50%;
         margin-bottom: 10px;
         padding-bottom: 20px;
         border-bottom: 0px solid #1d1d1d;
         background-color: #252A2E;
         border-radius: 20px;
      }
.d3-flame-graph rect {
         stroke: #252A2E;
         fill-opacity: .8;
      }
      .header h3 {
         margin-left: 40px;
         margin-top: 0px;
         margin-bottom: 0;
         line-height: 40px;
      }

      .text-muted {
         padding-top: 20px;
      }

      .pull-right {
         margin-top: 20px;
      }

      .chart {
         margin-left: 50px;
      }

      .highlight {
         fill: greenyellow !important;
      }

.d3-flame-graph-tip {
         visibility: hidden !important;
      }.balLogo {
         padding-left: 20px !important;
         padding-top: 25px !important;
         width: 200px !important;
         height: 50px !important;
      }

#chart {
         margin-top: 40px;
         margin-bottom: 40px;
         max-height: 780px;
         width: 1840px;
         border-radius: 20px;
         overflow-y: auto;
         overflow-x: auto;
         background-color: #252A2E;
      }#details{
         color: #fff;
         padding: 20px;
         position: absolute;
         left: 50%;
         font-weight: bold;
         transform: translate(-50%, -50%);
      }.form-control {
         border: solid 3px #fff;
         box-sizing: border-box;
         font-size: 17px;
         height: 2em;
         padding: .5em;
         transition: all 2s ease-in;
         width: 300px;
         z-index: 1;
      }

   </style>   <title>b7a-flamegraph</title>
</head>

<body>

      <div class="header clearfix">
         <nav>
            <div class="pull-right">
               <form class="form-inline" id="form">
                  
                  
                  <div class="form-group">
                     <input placeholder="Search..." id="searchBox" type="text" class="form-control">
                  </div>
                  <a class="btn btn-primary" href="javascript: search();">Search</a>
                  <a class="btn" href="javascript: resetZoom();">Reset zoom</a>
                  <a class="btn" href="javascript: clearSearch();">Clear</a>
               </form>
            </div>
         </nav>
         <img class="balLogo" src="https://ballerina.io/images/ballerina-logo-white.svg" alt="B7A">
      </div>
      <div id="chart"></div>
      <div id="details"></div>
   </div>

function search() {
         var term = document.getElementById("searchBox").value.toLowerCase();
         if (term) {
            var cells = d3.selectAll("rect");
            cells.classed("highlight", false);
            cells.each(function (d) {
               if (d.data.name.toLowerCase().indexOf(term) >= 0) {
                  d3.select(this).classed("highlight", true);
               }
            });
         }

         document.getElementById("searchBox").addEventListener("input", function () {
            if (this.value == "") {
               d3.selectAll("rect").classed("highlight", false);
            }
         });
      }

function saveAsHtml() {
  // Send an AJAX request to retrieve the current HTML content
  var xhr = new XMLHttpRequest();
  xhr.open("GET", window.location.href, true);
  xhr.onreadystatechange = function() {
    if (xhr.readyState === 4 && xhr.status === 200) {
      // Get the response text (the HTML code)
      var htmlContent = xhr.responseText;

      // Remove the button from the HTML content
      var parser = new DOMParser();
      var doc = parser.parseFromString(htmlContent, "text/html");
      var buttonToRemove = doc.getElementById("remove-me");
      if (buttonToRemove) {
        buttonToRemove.parentNode.removeChild(buttonToRemove);
      }
      var buttonToRemove1 = doc.getElementById("remove-me1");
      if (buttonToRemove1) {
        buttonToRemove1.parentNode.removeChild(buttonToRemove1);
      }
      htmlContent = doc.documentElement.outerHTML;

      // Create a new Blob object with the modified HTML content
      var blob = new Blob([htmlContent], {type: "text/html;charset=utf-8"});

      // Create a new anchor element to download the file
      var anchor = document.createElement("a");

      // Set the download attribute to the file name
      const currentTime = new Date().toLocaleString(); 
      const fileName = `Profiler_Result_${currentTime}.html`;      anchor.setAttribute("download", fileName);

      // Set the href attribute to the URL of the Blob object
      anchor.setAttribute("href", URL.createObjectURL(blob));

      // Click the anchor element to download the file
      anchor.click();
    }
  };
  xhr.send();
}
